import React, { useEffect, useState } from 'react'
import '../styles.css'
import EventIcon from '@mui/icons-material/Event'
import EventAvailableIcon from '@mui/icons-material/EventAvailable'
import EventBusyIcon from '@mui/icons-material/EventBusy'
import {
  fetchAllTrialsFromAPI,
  fetchBoxPlotFromAPI,
  fetchStaticAllExperiencesFromAPI,
  fetchStaticAllTypesFromAPI,
  fetchStaticCountWordsFromAPI,
  fetchStaticTimesFromAPI,
} from '../../api/StaticData'
import BoxPlot from '../charts/BoxPlot'
import WordCloud from '../charts/WordCloud'
import TimelineChart from '../charts/TimeLineChart'
import StackedBarChart from '../charts/StackedBarChart'

const OverviewPage = () => {
  const [sunData, setSunData] = useState([])
  const [dataLoaded, setDataLoaded] = useState(false)
  const [eventData, setEventData] = useState({})
  const [boxData, setBoxData] = useState({})
  const [eventWordData, setEventWordData] = useState({})
  const [wordCloudData, setWordCloudData] = useState([])
  const [timesData, setTimesData] = useState([])
  const [typesData, setTypesData] = useState([])
  const [expData, setExpData] = useState([])

  useEffect(() => {
    const fetchStaticData = async () => {
      try {
        const fetchedStaticData = await fetchAllTrialsFromAPI()
        setSunData(fetchedStaticData)
        setDataLoaded(true)
      } catch (error) {
        // Handle error
      }
    }

    fetchStaticData()
  }, [])

  const handleDataReceived = (data) => {
    setEventData(data)
  }

  const handleWordDataReceived = (data) => {
    setEventWordData(data)
  }

  useEffect(() => {
    const fetchWordCloudData = async () => {
      try {
        const fetchedData = await fetchStaticCountWordsFromAPI()
        setWordCloudData(fetchedData)
      } catch (error) {
        console.error('Error fetching word cloud data:', error)
      }
    }

    fetchWordCloudData()
  }, [])

  useEffect(() => {
    const fetchExpData = async () => {
      try {
        const fetchedData = await fetchStaticAllExperiencesFromAPI()
        setExpData(fetchedData)
      } catch (error) {
        console.error('Error fetching word cloud data:', error)
      }
    }

    fetchExpData()
  }, [])

  useEffect(() => {
    const fetchBoxPlotData = async () => {
      try {
        const fetchedData = await fetchBoxPlotFromAPI()
        setBoxData(fetchedData)
      } catch (error) {
        console.error('Error fetching box plot data:', error)
      }
    }

    fetchBoxPlotData()
  }, [])

  useEffect(() => {
    const fetchTimesData = async () => {
      try {
        const fetchedData = await fetchStaticTimesFromAPI()
        setTimesData(fetchedData)
      } catch (error) {
        console.error('Error fetching times data:', error)
      }
    }

    fetchTimesData()
  }, [])

  useEffect(() => {
    const fetchTypesData = async () => {
      try {
        const fetchedData = await fetchStaticAllTypesFromAPI()
        setTypesData(fetchedData)
      } catch (error) {
        console.error('Error fetching types data:', error)
      }
    }

    fetchTypesData()
  }, [])

  const handleLabelClick = async (label) => {
    const experienceId = label.split(' ')[0]
    const fetchedData = await fetchStaticTimesFromAPI(experienceId)
    setTimesData(fetchedData)
  }
  console.log(expData)
  return (
    <div className="container-fluid" style={{ paddingTop: '20px' }}>
      <div className="row">
        <div className="col-md-8">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            {
              <TimelineChart
                data={timesData}
                handleLabelClick={handleLabelClick}
                onDataReceived={handleDataReceived}
                onWordDataReceived={handleWordDataReceived}
              />
            }
          </div>
        </div>
        <div
          className="col-md-4"
          style={{ display: 'flex', justifyContent: 'flex-end' }}
        >
          <div className="flex-column">
            <div className="d-flex justify-content-between">
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#a6bddb',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Total Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.total_experiences}</h3>}
                </div>
              </div>
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#a6bddb',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Successful Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventAvailableIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.successful_experiences}</h3>}
                </div>
              </div>
              <div
                className="first-div"
                style={{
                  height: '200px',
                  width: '200px',
                  padding: '30px',
                  marginInline: '10px',
                  marginBottom: '20px',
                  background: '#a6bddb',
                }}
              >
                <h2
                  style={{
                    fontFamily: 'Arial, sans-serif',
                    fontSize: '24px',
                    fontWeight: 'bold',
                    color: '#333',
                    marginBottom: '10px',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  Error Experiences
                </h2>
                <div
                  style={{
                    border: '2px solid black',
                    borderRadius: '10px',
                    padding: '10px',
                    display: 'flex',
                    alignItems: 'center',
                    justifyContent: 'center',
                    textAlign: 'center',
                  }}
                >
                  <EventBusyIcon
                    fontSize={'large'}
                    style={{ marginRight: '10px' }}
                  />
                  {expData && <h3>{expData.error_experiences}</h3>}
                </div>
              </div>
            </div>
            <div
              className="first-div"
              style={{
                width: '100%',
                background: '#a6bddb',
                alignItems: 'center',
                justifyContent: 'center',
                textAlign: 'center',
                height: '200px',
                marginTop: '20px',
              }}
            >
              <h2>
                Pensar o que poderei colocar aqui! Talvez informação dos
                participantes!
              </h2>
            </div>
          </div>
        </div>
      </div>
      <div
        className="row"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            <h2
              style={{
                fontFamily: 'Arial, sans-serif',
                fontSize: '24px',
                fontWeight: 'bold',
                color: '#333',
                marginBottom: '10px',
              }}
            >
              In-Depth Data Analysis
            </h2>
            {dataLoaded && (
              <SunBurst
                data={sunData}
                onDataReceived={handleDataReceived}
                onWordDataReceived={handleWordDataReceived}
              />
            )}
          </div>
        </div>
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            <h2
              style={{
                fontFamily: 'Arial, sans-serif',
                fontSize: '24px',
                fontWeight: 'bold',
                color: '#333',
                marginBottom: '10px',
              }}
            >
              Data Distribution
            </h2>
            {eventData.length > 0 ? (
              <BoxPlot data={eventData} />
            ) : (
              <BoxPlot data={boxData} />
            )}
          </div>
        </div>
        <div className="col-md-4">
          <div
            className="first-div"
            style={{
              padding: '30px',
              marginBottom: '20px',
              background: '#a6bddb',
            }}
          >
            <h2
              style={{
                fontFamily: 'Arial, sans-serif',
                fontSize: '24px',
                fontWeight: 'bold',
                color: '#333',
                marginBottom: '10px',
              }}
            >
              Word Distribution
            </h2>
            {eventWordData.length > 0 ? (
              <WordCloud data={eventWordData} />
            ) : (
              <WordCloud data={wordCloudData} />
            )}
          </div>
        </div>
      </div>
      <div
        className="row"
        style={{ display: 'flex', justifyContent: 'center' }}
      >
        <div className="col-md-6">
          <div className="section" style={{ height: '500px', padding: '30px' }}>
            <StackedBarChart data={typesData} />
          </div>
        </div>
      </div>
    </div>
  )
}

export default OverviewPage
